(function() {

	var t = true;
	var ie_min_version = 9;
	var firefox_min_version = 25.0;
	var opera_min_version = 15.0;
	var safari_min_version = 6;
	var chrome_min_version = 30;

	function detect(ua) {

		function getFirstMatch(regex) {
			var match = ua.match(regex);
			return (match && match.length > 1 && match[1]) || '';
		}

		if (/opera|opr/i.test(ua)) {
			result = {
				name : 'Opera',
				opera : t,
				version : versionIdentifier
						|| getFirstMatch(/(?:opera|opr)[\s\/](\d+(\.\d+)?)/i)
			};
		} else if (/msie|trident/i.test(ua)) {
			result = {
				name : 'Internet Explorer',
				msie : t,
				version : getFirstMatch(/(?:msie |rv:)(\d+(\.\d+)?)/i)
			};
		} else if (/chrome|crios|crmo/i.test(ua)) {
			result = {
				name : 'Chrome',
				chrome : t,
				version : getFirstMatch(/(?:chrome|crios|crmo)\/(\d+(\.\d+)?)/i)
			};
		}  else if (/firefox|iceweasel/i.test(ua)) {
			result = {
				name : 'Firefox',
				firefox : t,
				version : getFirstMatch(/(?:firefox|iceweasel)[ \/](\d+(\.\d+)?)/i)
			};
		}  else if (/safari/i.test(ua)) {
			result = {
				name : 'Safari',
				safari : t,
				version : getFirstMatch(/(?:version)[ \/](\d+(\.\d+)?)/i)
			};
		} else {
			result = {};
		}

		if (/(apple)?webkit/i.test(ua)) {
			result.name = result.name || "Webkit";
			result.webkit = t;
			if (!result.version && versionIdentifier) {
				result.version = versionIdentifier;
			}
		} else if (!result.opera && /gecko\//i.test(ua)) {
			result.name = result.name || "Gecko";
			result.gecko = t;
			result.version = result.version
					|| getFirstMatch(/gecko\/(\d+(\.\d+)?)/i);
		}

		if ((result.msie && result.version >= ie_min_version)
				|| (result.chrome && result.version >= chrome_min_version)
				|| (result.firefox && result.version >= firefox_min_version)
				|| (result.safari && result.version >= safari_min_version)
				|| (result.opera && result.version >= opera_min_version)
				) {
			result.full_support = t;
		} else if ((result.msie && result.version < ie_min_version)
				|| (result.chrome && result.version < chrome_min_version)
				|| (result.firefox && result.version < firefox_min_version)
				|| (result.safari && result.version < safari_min_version)
				|| (result.opera && result.version < opera_min_version)
				) {
			result.unsupported = t;
		} else
			result.unknown = t;

		return result;
	}

	if(document.body==null){
		document.write("bad location for browser blocker, insert after body tag");
		return;
	}
	
	var resultDetect = detect(typeof navigator !== 'undefined' ? navigator.userAgent : '');
	
	if (resultDetect.unsupported) {
		document.body.className ="";
		document.body.innerHTML ="";
		 
		var div1 = document.createElement("div");
	    div1.innerHTML = "<br/><br/><br/><br/><h1 style=\"text-align:center\">For security reasons, the site can not be viewed with the browser currently in use</h1>";
	    document.body.appendChild(div1);
	    
	    var div2 = document.createElement("div");
	    div2.innerHTML = "<br/><br/><br/><br/><br/><br/><div style=\"text-align:center\">"+navigator.userAgent+"</div><br/>";
	    document.body.appendChild(div2);
	   
	    var ie = "<img src=\"data:image/png;base64,\"/>";
	    var safari = "<img src=\"data:image/png;base64,\"/>";
	    var firefox = "<img src=\"data:image/png;base64,\"/>";
	    var chrome = "<img src=\"data:image/png;base64,\"/>";
	    var opera = "<img src=\"data:image/png;base64,\"/>";
	    
	    var ballottScreen = "<div id=\"browsers\" class=\"browsers\"><table cellspacing=\"8\" cellpadding=\"8\" width=\"80%\" align=\"center\" style=\"background-color:#fff !important;\" id=\"_tableDescription\" summary=\"Seleziona i tuoi browser\"><tbody><tr>" + 
	    "<th>" + chrome + "</th>" +
	    "<th>" + firefox + "</th>" + 
	    "<th>" + ie + "</th>" + 
	    "<th>" + safari + "</th>" + 
	    "<th>" + opera + "</th></tr>" + 
	    "<tr><td id=\"_description_2\">Get a fast, free web browser</td>" + 
	    "<td id=\"_description_3\">Choose Independent. Choose Firefox.</td>" + 
	    "<td id=\"_description_4\">Internet Explorer is the browser built for touch, now with larger tabs, simpler controls, and fluid response to gestures.</td>" + 
	    "<td id=\"_description_1\">Safari. The best way to see the sites</td>" + 
	    "<td id=\"_description_5\">Download the fast and free web browser.</td></tr>" + 
	    "<tr><td><div class=\"browserTableLink\"><a target=\"_blank\" id=\"_installLink_2\" href=\"https://www.google.com/intl/en/chrome/browser/desktop\">Official Site</a></div></td>" + 
	    "<td><div class=\"browserTableLink\"><a target=\"_blank\" id=\"_installLink_3\" href=\"https://www.mozilla.org/en-US/firefox\">Official Site</a></div></td>" + 
	    "<td><div class=\"browserTableLink\"><a target=\"_blank\" id=\"_installLink_4\" href=\"http://windows.microsoft.com/en-us/internet-explorer/download-ie\">Official Site</a></div></td>" + 
	    "<td><div class=\"browserTableLink\"><a target=\"_blank\" id=\"_installLink_4\" href=\"https://www.apple.com/safari\">Official Site</a></div></td>" +
	    "<td><div class=\"browserTableLink\"><a target=\"_blank\" id=\"_installLink_5\" href=\"http://www.opera.com\">Official Site</a></div></td></tr></tbody></table></div>";
	    var div3 = document.createElement("div");
	    div3.innerHTML =ballottScreen;
	    document.body.appendChild(div3);
	}

})();
